import React from "react";

const Footer = () => {
  // Open social media in new tab
  const openInstagram = () => window.open("https://www.instagram.com", "_blank");
  const openPinterest = () => window.open("https://www.pinterest.com", "_blank");
  const openFacebook = () => window.open("https://www.facebook.com", "_blank");
  const openTwitter = () => window.open("https://www.twitter.com", "_blank");

  return (
    <footer>
      <div className="footer-content">
        <div className="footer-left">
          <h3>Contact Us On</h3>
          <p>Email: <a href="mailto:weblog@outlook.com">weblog@outlook.com</a></p>
          <p>Phone: +91 9080970408</p>
          <p>Address: Hello Home, Bangalore, India</p>
        </div>
        <div className="footer-center">
          <h3>Follow Us On</h3>
          <div className="social-icons">
            <button onClick={openInstagram}><i className="fa fa-instagram"></i></button>
            <button onClick={openPinterest}><i className="fa fa-pinterest"></i></button>
            <button onClick={openFacebook}><i className="fa fa-facebook"></i></button>
            <button onClick={openTwitter}><i className="fa fa-twitter"></i></button>
          </div>
        </div>
        <div className="footer-right">
          <h3>About Us</h3>
          <p>We`BLog is a travel platform dedicated to helping you explore the world. Join us for...</p>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
